var version = location.pathname == "\/3\/"; //true: /3/, false: /4/
var observed = false;

function jail3(){
    //console.log("jail run");
    document.getElementById("join0").innerHTML = "";
    document.getElementById("join1").innerHTML = "";
    document.getElementById("join2").innerHTML = "";
    document.getElementById("join3").innerHTML = "";
    document.getElementById("join4").innerHTML = "";
    document.getElementsByName("logout")[0].innerHTML = "ESCAPE";
}

function observe(){
    var div = (version ? document.getElementsByClassName("nosel tbl")[0] : document.getElementsByClassName("nosel")[1]);
    //var div = document.getElementsByClassName("nosel tbl")[0];
    if(!div){
        //console.log("no div");
        window.setTimeout(observe,500);
        return;
    }
    var observer = new MutationObserver(() => { (version ? jail3() : jail4()); });
    observer.observe(div, {
        attributes: true, childList: true, characterData: true
    });
}

function jail4List(){
    var btn = document.getElementsByClassName("btn nobr");
    for(var n = 0; n < btn.length; ++n){ btn[n].innerHTML = ""; }
    //console.log("activate");
}

function jail4(){
    //console.log("jail run");
    document.getElementById("join3").innerHTML = "";
    document.getElementById("join4").innerHTML = "";
    document.getElementsByName("c23")[0].innerHTML = "ESCAPE";
    var text = document.getElementsByClassName("ln")[0];
    if(!text){
        //console.log("no text");
        window.setTimeout(jail4,500);
        return;
    }
    if(!observed){
        var observer = new MutationObserver(() => { jail4List(); });
        observer.observe(text, { //if people count (and button text) change, rechange text.
            attributes: true, childList: true, characterData: true
        });
        observed = true;
    }
}

(function() {
    'use strict';

    observe();
    //document.addEventListener('contextmenu', jail, false);


})();